import React, { Component } from 'react'
import { Modal, Button } from 'semantic-ui-react';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";


export default class CreateAssign extends Component {
    constructor(){
        super()
        this.state={
            startDate: new Date(),
            title: "",
            assign: ""

        }
    }
    render() {
        return (

            <Modal size="large" trigger={<Button className="ui green button" >Create New Dish +</Button>}>
                <Modal.Header>Create New Assignment</Modal.Header>
                    <Modal.Content >
                       <form className="ui form" onSubmit={this.handleSubmit}>
                            <div className="field">
                                <label>Title</label>
                                <input type="text"  placeholder="title"
                                        name= "title"
                                        value = {this.state.title}
                                        onChange={this.handleChange}
                          />
                            </div>
                            <div className="field">
                                <label>Due Date:</label>
                                <DatePicker 
                                selected={this.state.startDate}
                                onChange={(date ) => this.handleDate(date)}

                                minDate={new Date()}    
                                />
                            </div>

                            <div className="field">
                                <label>Assignemt</label>
                                <textarea type="text"  placeholder="content"
                                onChange= {this.handleChange}
                                value = {this.state.assign}
                                name = "assign"
                                ></textarea>
                            </div>

                            <button className="ui button" type="submit">Submit</button>
                        </form>
                   </Modal.Content>
            </Modal>

        )
    }
}
